op: 20px; margin-bottom: 10px; font-size: 24px;\">CPU Prediction</h3>\r\n<p>This is CPU_Prediction.</p>','2017-05-22 02:49:07'),(39,21,2,1,'First Revision','CPU','CPU','','2017-05-22 08:19:55'),(40,22,2,1,'First Revision','CPU_test','CPU_test','<p>cpu test</p>','2017-05-25 08:31:06'),(41,23,2,1,'First Revision','hello','hello','','2017-05-25 08:37:43'),(42,24,2,1,NULL,'CPU_Prediction','CPU Prediction','<p>CPU Prediction</p>','2017-05-25 10:05:57'),(43,24,2,1,'First Revision','CPU_Prediction','CPU Prediction','<p>CPU Prediction</p>','2017-05-25 10:05:57'),(44,25,2,1,NULL,'CPU_hahahah','CPU hahahah','<p>CPU hahahah</p>','2017-05-25 10:41:36'),(45,25,2,1,'First Revision','CPU_hahahah','CPU hahahah','<p>CPU hahahah</p>','2017-05-25 10:41:36'),(46,26,2,1,NULL,'edqwedwea','edqwedwea','<p>dqewdeqwdqwefqwef</p>','2017-05-25 10:43:02'),(47,26,2,1,'First Revision','edqwedwea','edqwedwea','<p>dqewdeqwdqwefqwef</p>','2017-05-25 10:43:02'),(48,27,2,1,NULL,'sdas','sdas','<p>dawdawd</p>','2017-05-25 10:45:39'),(49,27,2,1,'First Revision','sdas','sdas','<p>dawdawd</p>','2017-05-25 10:45:39'),(50,28,2,1,NULL,'rff','rff','','2017-05-25 10:47:46'),(51,28,2,1,'First Revision','rff','rff','','2017-05-25 10:47:46'),(52,29,2,1,NULL,'name','name','','2017-05-25 10:48:40'),(53,29,2,1,'First Revision','name','name','','2017-05-25 10:48:40'),(54,30,2,1,NULL,'name','name','','2017-05-25 10:51:27'),(55,30,2,1,'First Revision','name','name','','2017-05-25 10:51:27'),(56,31,2,1,NULL,'rff','rff','','2017-05-25 10:51:44'),(57,31,2,1,'First Revision','rff','rff','','2017-05-25 10:51:44'),(58,32,2,1,NULL,'Stock_predict','Stock predict','','2017-05-25 10:53:49'),(59,32,2,1,'First Revision','Stock_predict','Stock predict','','2017-05-25 10:53:50'),(60,32,2,2,'Add content','Stock_predict','Stock predict','<h3 style=\"box-sizing: border-box; outline-width: 0px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-weight: 500; line-height: 1.1; color: #333333; margin-top: 20px; margin-bottom: 10px; font-size: 24px;\">Stock prediction</h3>\r\n<p>Stock market prediction<span style=\"color: #222222; font-family: sans-serif;\">&nbsp;is the act of trying to determine the future value of a company&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\" title=\"Stock\" href=\"https://en.wikipedia.org/wiki/Stock\">stock</a><span style=\"color: #222222; font-family: sans-serif;\">&nbsp;or other&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\" title=\"Financial instrument\" href=\"https://en.wikipedia.org/wiki/Financial_instrument\">financial instrument</a><span style=\"color: #222222; font-family: sans-serif;\">&nbsp;traded on an&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\" title=\"Exchange (organized market)\" href=\"https://en.wikipedia.org/wiki/Exchange_(organized_market)\">exchange</a><span style=\"color: #222222; font-family: sans-serif;\">. The successful prediction of a stock\'s future price could yield significant profit. The&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: sans-serif;\" title=\"Efficient-market hypothesis\" href=\"https://en.wikipedia.org/wiki/Efficient-market_hypothesis\">efficient-market hypothesis</a><span style=\"color: #222222; font-family: sans-serif;\">&nbsp;suggests that stock prices reflect all currently available information and any price changes that are not based on newly revealed information thus are inherently unpredictable. Others disagree and those with this viewpoint possess myriad methods and technologies which purportedly allow them to gain future price information.</span></p>','2017-05-25 10:59:53'),(61,33,2,1,NULL,'CPU_Prediction','CPU Prediction','','2017-05-25 11:07:03'),(62,33,2,1,'First Revision','CPU_Prediction','CPU Prediction','','2017-05-25 11:07:03'),(63,34,5,1,NULL,'Test_admin','Test admin','','2017-05-25 14:39:45'),(64,34,5,1,'First Revision','Test_admin','Test admin','','2017-05-25 14:39:45'),(65,34,5,2,'','Test_admin','Test admin','<p style=\"margin-top: 0px; padding-right: 20px; padding-left: 20px; font-family: Arial, Helvetica, sans-serif; font-size: medium;\">The purpose of the test is to gauge the network security system\'s ability to&nbsp;<strong>find the actual target string</strong>&nbsp;in the content. In the real world, you would not know where the threats were coming from or what the exact delivery vehicle would be. The objective is to create a&nbsp;<strong>single content rule</strong>&nbsp;that fires on&nbsp;<strong>all</strong>&nbsp;of the Test Files but not on&nbsp;<strong>any</strong>&nbsp;of the Negative Control files. So triggering on the test files\' URLs or HTTP headers or filenames or MD5 hashes and stuff like that is&nbsp;<strong>cheating</strong>&nbsp;and&nbsp;<strong>it doesn\'t count.</strong>&nbsp;If the teacher catches you, you\'re going to be in trouble!</p>\r\n<p style=\"margin-top: 0px; padding-right: 20px; padding-left: 20px; font-family: Arial, Helvetica, sans-serif; font-size: medium;\">* Note: In the test files where the target string is embedded in a Windows executable file (e.g. Test Files 20, 21, 26 and 27), the characters in the target string are separated by ASCII NULL characters. In PCRE syntax, the target string, when compiled into an exe file, would appear as e\\x00v\\x00a\\x00l\\x00(\\x00u\\x00n\\x00e\\x00s\\x00c... So your rule should look for both the target string as depicted above in red and the NULL-separated version.</p>\r\n<p style=\"margin-top: 0px; padding-right: 20px; padding-left: 20px; font-family: Arial, Helvetica, sans-serif; font-size: medium;\">To test your network security system\'s Content IQ&trade;:</p>\r\n<ul style=\"padding: 0px 20px 15px 40px; margin: 0px; font-family: Arial, Helvetica, sans-serif; font-size: medium;\">\r\n<li style=\"margin-top: 10px;\">Set your network security system up to look for the target string (or some representative sub-string of the target string). Normally this involves creating a content rule that generates an alert when it sees the target string.</li>\r\n<li style=\"margin-top: 10px;\">Click on the link that says \"Click Here to Download All Test Files Automatically\" or click on each of the Test File links individually. This will cause the files to be downloaded across your network to your browser and through (or past) your network security system. Each Test File should generate an alert on your network security system.</li>\r\n<li style=\"margin-top: 10px;\">Check to see how many of the Test Files were identified by your network security system as containing the target string.</li>\r\n<li style=\"margin-top: 10px;\">For extra credit, see if you can&nbsp;<strong>recover the Test Files</strong>&nbsp;from your network security system\'s alert database or packet store.</li>\r\n<li style=\"margin-top: 10px;\">For extra extra credit, see if your network security system can&nbsp;<strong>prevent</strong>&nbsp;the Test Files from entering your network.</li>\r\n<li style=\"margin-top: 10px;\">Click on each of the Negative Control Files. They are the same as the corresponding Test Files above except that&nbsp;<strong>they do not contain the target string</strong>. Your network security system should&nbsp;<strong>not</strong>&nbsp;trigger on any of the Negative Control Files. If it does, it\'s a false positive.</li>\r\n</ul>\r\n<p style=\"margin-top: 0px; padding-right: 20px; padding-left: 20px; font-family: Arial, Helvetica, sans-serif; font-size: medium;\">&nbsp;</p>','2017-05-26 11:26:18'),(66,18,5,2,'','None','None','<p>[[Test admin]]</p>','2017-05-30 06:30:21'),(67,18,5,3,'','None','None','','2017-05-30 06:30:56'),(68,35,5,1,NULL,'Stock_predict','Stock predict','<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\"><strong>Stock market prediction</strong>&nbsp;is the act of trying to determine the future value of a company&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Stock\" href=\"https://en.wikipedia.org/wiki/Stock\">stock</a>&nbsp;or other&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Financial instrument\" href=\"https://en.wikipedia.org/wiki/Financial_instrument\">financial instrument</a>&nbsp;traded on an&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Exchange (organized market)\" href=\"https://en.wikipedia.org/wiki/Exchange_(organized_market)\">exchange</a>. The successful prediction of a stock\'s future price could yield significant profit. The&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Efficient-market hypothesis\" href=\"https://en.wikipedia.org/wiki/Efficient-market_hypothesis\">efficient-market hypothesis</a>&nbsp;suggests that stock prices reflect all currently available information and any price changes that are not based on newly revealed information thus are inherently unpredictable. Others disagree and those with this viewpoint possess myriad methods and technologies which purportedly allow them to gain future price information.<span id=\"The_Efficient_Markets_Hypothesis_and_the_random_walk\" class=\"mw-headline\">The Efficient Markets Hypothesis and the random walk</span></p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">The&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Efficient-market hypothesis\" href=\"https://en.wikipedia.org/wiki/Efficient-market_hypothesis\">efficient-market hypothesis</a>&nbsp;posits that stock prices are a function of information and rational expectations, and that newly revealed information about a company\'s prospects is almost immediately reflected in the current stock price. This would imply that all publicly known information about a company, which obviously includes its price history, would already be reflected in the current price of the stock. Accordingly, changes in the stock price reflect release of new information, changes in the market generally, or random movements around the value that reflects the existing information set.&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Burton Malkiel\" href=\"https://en.wikipedia.org/wiki/Burton_Malkiel\">Burton Malkiel</a>, in his influential 1973 work&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"A Random Walk Down Wall Street\" href=\"https://en.wikipedia.org/wiki/A_Random_Walk_Down_Wall_Street\">A Random Walk Down Wall Street</a>, claimed that stock prices could therefore not be accurately predicted by looking at price history. As a result, Malkiel argued, stock prices are best described by a statistical process called a \"random walk\" meaning each day\'s deviations from the central value are random and unpredictable. This led Malkiel to conclude that paying financial services persons to predict the market actually hurt, rather than helped, net portfolio return. A number of empirical tests support the notion that the theory applies generally, as most portfolios managed by professional stock predictors do not outperform the market average return after accounting for the managers\' fees.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">While the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Efficient-market hypothesis\" href=\"https://en.wikipedia.org/wiki/Efficient-market_hypothesis\">efficient-market hypothesis</a>&nbsp;finds favor among financial academics, but its critics point to instances in which actual market experience differs from the prediction-of-unpredictability the hypothesis implies. A large industry has grown up around the implication proposition that some analysts can predict stocks better than others; ironically that would be impossible under the Efficient Markets Hypothesis if the stock prediction industry did not offer something its customers believed to be of value.</p>\r\n<h2 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-weight: normal; margin: 1em 0px 0.25em; overflow: hidden; padding: 0px; border-bottom: 1px solid #a2a9b1; font-family: \'Linux Libertine\', Georgia, Times, serif; line-height: 1.3;\"><span id=\"Prediction_methods\" class=\"mw-headline\">Prediction methods</span></h2>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Prediction methodologies fall into three broad categories which can (and often do) overlap. They are&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Fundamental analysis\" href=\"https://en.wikipedia.org/wiki/Fundamental_analysis\">fundamental analysis</a>,&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Technical analysis\" href=\"https://en.wikipedia.org/wiki/Technical_analysis\">technical analysis</a>&nbsp;(charting) and technological methods.</p>\r\n<h3 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; font-size: 1.2em; line-height: 1.6; font-family: sans-serif;\"><span id=\"Fundamental_analysis\" class=\"mw-headline\">Fundamental analysis</span></h3>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Fundamental Analysts are concerned with the company that underlies the stock itself. They evaluate a company\'s past performance as well as the credibility of its&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Account (accountancy)\" href=\"https://en.wikipedia.org/wiki/Account_(accountancy)\">accounts</a>. Many performance ratios are created that aid the fundamental analyst with assessing the validity of a stock, such as the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"P/E ratio\" href=\"https://en.wikipedia.org/wiki/P/E_ratio\">P/E ratio</a>.&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Warren Buffett\" href=\"https://en.wikipedia.org/wiki/Warren_Buffett\">Warren Buffett</a>&nbsp;is perhaps the most famous of all Fundamental Analysts.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Fundamental analysis is built on the belief that human society needs capital to make progress and if a company operates well, it should be rewarded with additional capital and result in a surge in stock price. Fundamental analysis is widely used by fund managers as it is the most reasonable, objective and made from publicly available information like financial statement analysis.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Another meaning of fundamental analysis is beyond bottom-up company analysis, it refers to top-down analysis from first analyzing the global economy, followed by country analysis and then sector analysis, and finally the company level analysis.</p>\r\n<h3 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; font-size: 1.2em; line-height: 1.6; font-family: sans-serif;\"><span id=\"Technical_analysis\" class=\"mw-headline\">Technical analysis</span></h3>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Technical analysts or chartists are not concerned with any of the company\'s fundamentals. They seek to determine the future price of a stock based solely on the (potential) trends of the past price (a form of&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Time series analysis\" href=\"https://en.wikipedia.org/wiki/Time_series_analysis\">time series analysis</a>). Numerous patterns are employed such as the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Head and shoulders (chart pattern)\" href=\"https://en.wikipedia.org/wiki/Head_and_shoulders_(chart_pattern)\">head and shoulders</a>&nbsp;or&nbsp;<a class=\"new\" style=\"text-decoration-line: none; color: #a55858; background: none;\" title=\"Cup and saucer (chart pattern) (page does not exist)\" href=\"https://en.wikipedia.org/w/index.php?title=Cup_and_saucer_(chart_pattern)&amp;action=edit&amp;redlink=1\">cup and saucer</a>. Alongside the patterns, statistical techniques are used such as the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Exponential moving average\" href=\"https://en.wikipedia.org/wiki/Exponential_moving_average\">exponential moving average</a>&nbsp;(EMA). Candle stick patterns are believed to be first developed by Japanese rice merchants, and nowadays widely used by technical analysts.</p>\r\n<h3 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; font-size: 1.2em; line-height: 1.6; font-family: sans-serif;\"><span id=\"Data_Mining_Technologies_.28e.g._ANN.29\" class=\"mw-headline\">Data Mining Technologies (e.g. ANN)</span></h3>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">With the advent of the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Digital computer\" href=\"https://en.wikipedia.org/wiki/Digital_computer\">digital computer</a>, stock market prediction has since moved into the technological realm. The most prominent technique involves the use of&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Artificial neural networks\" href=\"https://en.wikipedia.org/wiki/Artificial_neural_networks\">artificial neural networks</a>&nbsp;(ANNs) and Genetic Algorithms. Scholars found bacterial chemotaxis optimization method may perform better than GA.<sup id=\"cite_ref-1\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-1\">[1]</a></sup>&nbsp;ANNs can be thought of as&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Mathematical function\" href=\"https://en.wikipedia.org/wiki/Mathematical_function\">mathematical function</a>&nbsp;approximators. The most common form of ANN in use for stock market prediction is the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Feedforward neural network\" href=\"https://en.wikipedia.org/wiki/Feedforward_neural_network\">feed forward network</a>&nbsp;utilising the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Backpropagation\" href=\"https://en.wikipedia.org/wiki/Backpropagation\">backward propagation of errors</a>&nbsp;algorithm to update the network weights. These networks are commonly referred to as&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Backpropagation\" href=\"https://en.wikipedia.org/wiki/Backpropagation\">Backpropagation</a>&nbsp;networks. Another form of ANN that is more appropriate for stock prediction is the time&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Recurrent neural network\" href=\"https://en.wikipedia.org/wiki/Recurrent_neural_network\">recurrent neural network</a>&nbsp;(RNN) or&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Time delay neural network\" href=\"https://en.wikipedia.org/wiki/Time_delay_neural_network\">time delay neural network</a>&nbsp;(TDNN). Examples of RNN and TDNN are the Elman, Jordan, and Elman-Jordan networks. (See the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Recurrent neural network\" href=\"https://en.wikipedia.org/wiki/Recurrent_neural_network#Elman_networks_and_Jordan_networks\">Elman And Jordan Networks</a>)..</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">For stock prediction with ANNs, there are usually two approaches taken for forecasting different time horizons: independent and joint. The independent approach employs a single ANN for each time horizon, for example, 1-day, 2-day, or 5-day. The advantage of this approach is that network forecasting error for one horizon won\'t impact the error for another horizon&mdash;since each time horizon is typically a unique problem. The joint approach, however, incorporates multiple time horizons together so that they are determined simultaneously. In this approach, forecasting error for one time horizon may share its error with that of another horizon, which can decrease performance. There are also more parameters required for a joint model, which increases the risk of overfitting.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Of late, the majority of academic research groups studying ANNs for stock forecasting seem to be using an ensemble of independent ANNs methods more frequently, with greater success. An ensemble of ANNs would use low price and time lags to predict future lows, while another network would use lagged highs to predict future highs. The predicted low and high predictions are then used to form stop prices for buying or selling. Outputs from the individual \"low\" and \"high\" networks can also be input into a final network that would also incorporate volume, intermarket data or statistical summaries of prices, leading to a final ensemble output that would trigger buying, selling, or market directional change. A major finding with ANNs and stock prediction is that a classification approach (vs. function approximation) using outputs in the form of buy(y=+1) and sell(y=-1) results in better predictive reliability than a quantitative output such as low or high price.<sup id=\"cite_ref-2\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-2\">[2]</a></sup>&nbsp;This is explained by the fact that an ANN can predict class better than a quantitative value as in function approximation&mdash;since ANNs occasionally learn more about the noise in the input data.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Since NNs require training and can have a large parameter space, it is useful to modify the network structure for optimal predictive ability.</p>\r\n<h4 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; line-height: 1.6; font-family: sans-serif;\"><span id=\"Internet-based_data_sources_for_stock_market_prediction\" class=\"mw-headline\">Internet-based data sources for stock market prediction</span></h4>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Tobias Preis\" href=\"https://en.wikipedia.org/wiki/Tobias_Preis\">Tobias Preis</a>&nbsp;et al. introduced a method to identify online precursors for stock market moves, using trading strategies based on search volume data provided by&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Google Trends\" href=\"https://en.wikipedia.org/wiki/Google_Trends\">Google Trends</a>.<sup id=\"cite_ref-3\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-3\">[3]</a></sup>&nbsp;Their analysis of&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Google\" href=\"https://en.wikipedia.org/wiki/Google\">Google</a>&nbsp;search volume for 98 terms of varying financial relevance, published in&nbsp;<em><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Scientific Reports\" href=\"https://en.wikipedia.org/wiki/Scientific_Reports\">Scientific Reports</a></em>,<sup id=\"cite_ref-4\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-4\">[4]</a></sup>&nbsp;suggests that increases in search volume for financially relevant search terms tend to precede large losses in financial markets.<sup id=\"cite_ref-5\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-5\">[5]</a></sup><sup id=\"cite_ref-6\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-6\">[6]</a></sup><sup id=\"cite_ref-7\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-7\">[7]</a></sup><sup id=\"cite_ref-8\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-8\">[8]</a></sup><sup id=\"cite_ref-9\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-9\">[9]</a></sup><sup id=\"cite_ref-10\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-10\">[10]</a></sup><sup id=\"cite_ref-11\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-11\">[11]</a></sup><sup id=\"cite_ref-12\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-12\">[12]</a></sup>&nbsp;Out of these terms, three were significant at the 5% level (|<em>z</em>| &gt; 1.96). The best term in the negative direction was \"debt\", followed by \"color\".</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">In a study published in&nbsp;<em><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Scientific Reports\" href=\"https://en.wikipedia.org/wiki/Scientific_Reports\">Scientific Reports</a></em>&nbsp;in 2013,<sup id=\"cite_ref-13\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-13\">[13]</a></sup>&nbsp;Helen Susannah Moat,&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Tobias Preis\" href=\"https://en.wikipedia.org/wiki/Tobias_Preis\">Tobias Preis</a>&nbsp;and colleagues demonstrated a link between changes in the number of views of&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"English Wikipedia\" href=\"https://en.wikipedia.org/wiki/English_Wikipedia\">English Wikipedia</a>&nbsp;articles relating to financial topics and subsequent large stock market moves.<sup id=\"cite_ref-14\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-14\">[14]</a></sup></p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">The collective mood of&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Twitter\" href=\"https://en.wikipedia.org/wiki/Twitter\">Twitter</a>&nbsp;messages has been linked to stock market performance.<sup id=\"cite_ref-15\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-15\">[15]</a></sup>&nbsp;The study, however, has been criticized for its methodology.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">The activity in stock message boards has been mined in order to predict asset returns.<sup id=\"cite_ref-Galvez2017_16-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-Galvez2017-16\">[16]</a></sup></p>\r\n<h4 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; line-height: 1.6; font-family: sans-serif;\"><span id=\"Applications_of_Complexity_Science_for_stock_market_prediction\" class=\"mw-headline\">Applications of Complexity Science for stock market prediction</span></h4>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Using new statistical analysis tools of&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Complexity economics\" href=\"https://en.wikipedia.org/wiki/Complexity_economics\">complexity theory</a>, researchers at the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"New England Complex Systems Institute\" href=\"https://en.wikipedia.org/wiki/New_England_Complex_Systems_Institute\">New England Complex Systems Institute</a>&nbsp;(NECSI) performed research on predicting&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Stock market crash\" href=\"https://en.wikipedia.org/wiki/Stock_market_crash\">stock market crashes</a>.<sup id=\"cite_ref-17\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-17\">[17]</a></sup><sup id=\"cite_ref-18\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-18\">[18]</a></sup><sup id=\"cite_ref-19\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-19\">[19]</a></sup>&nbsp;It has long been thought that market crashes are triggered by panics that may or may not be justified by external news. This research indicates that it is the internal structure of the market, not external crises, which is primarily responsible for crashes. The number of different stocks that move up or down together were shown to be an indicator of the mimicry within the market, how much investors look to one another for cues. When the mimicry is high, many stocks follow each other\'s movements - a prime reason for panic to take hold. It was shown that a dramatic increase in market mimicry occurred during the entire year before each market crash of the past 25 years, including the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Financial crisis of 2007&ndash;08\" href=\"https://en.wikipedia.org/wiki/Financial_crisis_of_2007%E2%80%9308\">financial crisis of 2007&ndash;08</a>.</p>','2017-05-30 13:46:31'),(69,35,5,1,'First Revision','Stock_predict','Stock predict','<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\"><strong>Stock market prediction</strong>&nbsp;is the act of trying to determine the future value of a company&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Stock\" href=\"https://en.wikipedia.org/wiki/Stock\">stock</a>&nbsp;or other&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Financial instrument\" href=\"https://en.wikipedia.org/wiki/Financial_instrument\">financial instrument</a>&nbsp;traded on an&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Exchange (organized market)\" href=\"https://en.wikipedia.org/wiki/Exchange_(organized_market)\">exchange</a>. The successful prediction of a stock\'s future price could yield significant profit. The&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Efficient-market hypothesis\" href=\"https://en.wikipedia.org/wiki/Efficient-market_hypothesis\">efficient-market hypothesis</a>&nbsp;suggests that stock prices reflect all currently available information and any price changes that are not based on newly revealed information thus are inherently unpredictable. Others disagree and those with this viewpoint possess myriad methods and technologies which purportedly allow them to gain future price information.<span id=\"The_Efficient_Markets_Hypothesis_and_the_random_walk\" class=\"mw-headline\">The Efficient Markets Hypothesis and the random walk</span></p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">The&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Efficient-market hypothesis\" href=\"https://en.wikipedia.org/wiki/Efficient-market_hypothesis\">efficient-market hypothesis</a>&nbsp;posits that stock prices are a function of information and rational expectations, and that newly revealed information about a company\'s prospects is almost immediately reflected in the current stock price. This would imply that all publicly known information about a company, which obviously includes its price history, would already be reflected in the current price of the stock. Accordingly, changes in the stock price reflect release of new information, changes in the market generally, or random movements around the value that reflects the existing information set.&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Burton Malkiel\" href=\"https://en.wikipedia.org/wiki/Burton_Malkiel\">Burton Malkiel</a>, in his influential 1973 work&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"A Random Walk Down Wall Street\" href=\"https://en.wikipedia.org/wiki/A_Random_Walk_Down_Wall_Street\">A Random Walk Down Wall Street</a>, claimed that stock prices could therefore not be accurately predicted by looking at price history. As a result, Malkiel argued, stock prices are best described by a statistical process called a \"random walk\" meaning each day\'s deviations from the central value are random and unpredictable. This led Malkiel to conclude that paying financial services persons to predict the market actually hurt, rather than helped, net portfolio return. A number of empirical tests support the notion that the theory applies generally, as most portfolios managed by professional stock predictors do not outperform the market average return after accounting for the managers\' fees.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">While the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Efficient-market hypothesis\" href=\"https://en.wikipedia.org/wiki/Efficient-market_hypothesis\">efficient-market hypothesis</a>&nbsp;finds favor among financial academics, but its critics point to instances in which actual market experience differs from the prediction-of-unpredictability the hypothesis implies. A large industry has grown up around the implication proposition that some analysts can predict stocks better than others; ironically that would be impossible under the Efficient Markets Hypothesis if the stock prediction industry did not offer something its customers believed to be of value.</p>\r\n<h2 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-weight: normal; margin: 1em 0px 0.25em; overflow: hidden; padding: 0px; border-bottom: 1px solid #a2a9b1; font-family: \'Linux Libertine\', Georgia, Times, serif; line-height: 1.3;\"><span id=\"Prediction_methods\" class=\"mw-headline\">Prediction methods</span></h2>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Prediction methodologies fall into three broad categories which can (and often do) overlap. They are&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Fundamental analysis\" href=\"https://en.wikipedia.org/wiki/Fundamental_analysis\">fundamental analysis</a>,&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Technical analysis\" href=\"https://en.wikipedia.org/wiki/Technical_analysis\">technical analysis</a>&nbsp;(charting) and technological methods.</p>\r\n<h3 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; font-size: 1.2em; line-height: 1.6; font-family: sans-serif;\"><span id=\"Fundamental_analysis\" class=\"mw-headline\">Fundamental analysis</span></h3>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Fundamental Analysts are concerned with the company that underlies the stock itself. They evaluate a company\'s past performance as well as the credibility of its&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Account (accountancy)\" href=\"https://en.wikipedia.org/wiki/Account_(accountancy)\">accounts</a>. Many performance ratios are created that aid the fundamental analyst with assessing the validity of a stock, such as the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"P/E ratio\" href=\"https://en.wikipedia.org/wiki/P/E_ratio\">P/E ratio</a>.&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Warren Buffett\" href=\"https://en.wikipedia.org/wiki/Warren_Buffett\">Warren Buffett</a>&nbsp;is perhaps the most famous of all Fundamental Analysts.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Fundamental analysis is built on the belief that human society needs capital to make progress and if a company operates well, it should be rewarded with additional capital and result in a surge in stock price. Fundamental analysis is widely used by fund managers as it is the most reasonable, objective and made from publicly available information like financial statement analysis.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Another meaning of fundamental analysis is beyond bottom-up company analysis, it refers to top-down analysis from first analyzing the global economy, followed by country analysis and then sector analysis, and finally the company level analysis.</p>\r\n<h3 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; font-size: 1.2em; line-height: 1.6; font-family: sans-serif;\"><span id=\"Technical_analysis\" class=\"mw-headline\">Technical analysis</span></h3>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Technical analysts or chartists are not concerned with any of the company\'s fundamentals. They seek to determine the future price of a stock based solely on the (potential) trends of the past price (a form of&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Time series analysis\" href=\"https://en.wikipedia.org/wiki/Time_series_analysis\">time series analysis</a>). Numerous patterns are employed such as the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Head and shoulders (chart pattern)\" href=\"https://en.wikipedia.org/wiki/Head_and_shoulders_(chart_pattern)\">head and shoulders</a>&nbsp;or&nbsp;<a class=\"new\" style=\"text-decoration-line: none; color: #a55858; background: none;\" title=\"Cup and saucer (chart pattern) (page does not exist)\" href=\"https://en.wikipedia.org/w/index.php?title=Cup_and_saucer_(chart_pattern)&amp;action=edit&amp;redlink=1\">cup and saucer</a>. Alongside the patterns, statistical techniques are used such as the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Exponential moving average\" href=\"https://en.wikipedia.org/wiki/Exponential_moving_average\">exponential moving average</a>&nbsp;(EMA). Candle stick patterns are believed to be first developed by Japanese rice merchants, and nowadays widely used by technical analysts.</p>\r\n<h3 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; font-size: 1.2em; line-height: 1.6; font-family: sans-serif;\"><span id=\"Data_Mining_Technologies_.28e.g._ANN.29\" class=\"mw-headline\">Data Mining Technologies (e.g. ANN)</span></h3>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">With the advent of the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Digital computer\" href=\"https://en.wikipedia.org/wiki/Digital_computer\">digital computer</a>, stock market prediction has since moved into the technological realm. The most prominent technique involves the use of&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Artificial neural networks\" href=\"https://en.wikipedia.org/wiki/Artificial_neural_networks\">artificial neural networks</a>&nbsp;(ANNs) and Genetic Algorithms. Scholars found bacterial chemotaxis optimization method may perform better than GA.<sup id=\"cite_ref-1\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-1\">[1]</a></sup>&nbsp;ANNs can be thought of as&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Mathematical function\" href=\"https://en.wikipedia.org/wiki/Mathematical_function\">mathematical function</a>&nbsp;approximators. The most common form of ANN in use for stock market prediction is the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Feedforward neural network\" href=\"https://en.wikipedia.org/wiki/Feedforward_neural_network\">feed forward network</a>&nbsp;utilising the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Backpropagation\" href=\"https://en.wikipedia.org/wiki/Backpropagation\">backward propagation of errors</a>&nbsp;algorithm to update the network weights. These networks are commonly referred to as&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Backpropagation\" href=\"https://en.wikipedia.org/wiki/Backpropagation\">Backpropagation</a>&nbsp;networks. Another form of ANN that is more appropriate for stock prediction is the time&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Recurrent neural network\" href=\"https://en.wikipedia.org/wiki/Recurrent_neural_network\">recurrent neural network</a>&nbsp;(RNN) or&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Time delay neural network\" href=\"https://en.wikipedia.org/wiki/Time_delay_neural_network\">time delay neural network</a>&nbsp;(TDNN). Examples of RNN and TDNN are the Elman, Jordan, and Elman-Jordan networks. (See the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Recurrent neural network\" href=\"https://en.wikipedia.org/wiki/Recurrent_neural_network#Elman_networks_and_Jordan_networks\">Elman And Jordan Networks</a>)..</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">For stock prediction with ANNs, there are usually two approaches taken for forecasting different time horizons: independent and joint. The independent approach employs a single ANN for each time horizon, for example, 1-day, 2-day, or 5-day. The advantage of this approach is that network forecasting error for one horizon won\'t impact the error for another horizon&mdash;since each time horizon is typically a unique problem. The joint approach, however, incorporates multiple time horizons together so that they are determined simultaneously. In this approach, forecasting error for one time horizon may share its error with that of another horizon, which can decrease performance. There are also more parameters required for a joint model, which increases the risk of overfitting.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Of late, the majority of academic research groups studying ANNs for stock forecasting seem to be using an ensemble of independent ANNs methods more frequently, with greater success. An ensemble of ANNs would use low price and time lags to predict future lows, while another network would use lagged highs to predict future highs. The predicted low and high predictions are then used to form stop prices for buying or selling. Outputs from the individual \"low\" and \"high\" networks can also be input into a final network that would also incorporate volume, intermarket data or statistical summaries of prices, leading to a final ensemble output that would trigger buying, selling, or market directional change. A major finding with ANNs and stock prediction is that a classification approach (vs. function approximation) using outputs in the form of buy(y=+1) and sell(y=-1) results in better predictive reliability than a quantitative output such as low or high price.<sup id=\"cite_ref-2\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-2\">[2]</a></sup>&nbsp;This is explained by the fact that an ANN can predict class better than a quantitative value as in function approximation&mdash;since ANNs occasionally learn more about the noise in the input data.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Since NNs require training and can have a large parameter space, it is useful to modify the network structure for optimal predictive ability.</p>\r\n<h4 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; line-height: 1.6; font-family: sans-serif;\"><span id=\"Internet-based_data_sources_for_stock_market_prediction\" class=\"mw-headline\">Internet-based data sources for stock market prediction</span></h4>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Tobias Preis\" href=\"https://en.wikipedia.org/wiki/Tobias_Preis\">Tobias Preis</a>&nbsp;et al. introduced a method to identify online precursors for stock market moves, using trading strategies based on search volume data provided by&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Google Trends\" href=\"https://en.wikipedia.org/wiki/Google_Trends\">Google Trends</a>.<sup id=\"cite_ref-3\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-3\">[3]</a></sup>&nbsp;Their analysis of&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Google\" href=\"https://en.wikipedia.org/wiki/Google\">Google</a>&nbsp;search volume for 98 terms of varying financial relevance, published in&nbsp;<em><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Scientific Reports\" href=\"https://en.wikipedia.org/wiki/Scientific_Reports\">Scientific Reports</a></em>,<sup id=\"cite_ref-4\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-4\">[4]</a></sup>&nbsp;suggests that increases in search volume for financially relevant search terms tend to precede large losses in financial markets.<sup id=\"cite_ref-5\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-5\">[5]</a></sup><sup id=\"cite_ref-6\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-6\">[6]</a></sup><sup id=\"cite_ref-7\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-7\">[7]</a></sup><sup id=\"cite_ref-8\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-8\">[8]</a></sup><sup id=\"cite_ref-9\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-9\">[9]</a></sup><sup id=\"cite_ref-10\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-10\">[10]</a></sup><sup id=\"cite_ref-11\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-11\">[11]</a></sup><sup id=\"cite_ref-12\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-12\">[12]</a></sup>&nbsp;Out of these terms, three were significant at the 5% level (|<em>z</em>| &gt; 1.96). The best term in the negative direction was \"debt\", followed by \"color\".</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">In a study published in&nbsp;<em><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Scientific Reports\" href=\"https://en.wikipedia.org/wiki/Scientific_Reports\">Scientific Reports</a></em>&nbsp;in 2013,<sup id=\"cite_ref-13\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-13\">[13]</a></sup>&nbsp;Helen Susannah Moat,&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Tobias Preis\" href=\"https://en.wikipedia.org/wiki/Tobias_Preis\">Tobias Preis</a>&nbsp;and colleagues demonstrated a link between changes in the number of views of&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"English Wikipedia\" href=\"https://en.wikipedia.org/wiki/English_Wikipedia\">English Wikipedia</a>&nbsp;articles relating to financial topics and subsequent large stock market moves.<sup id=\"cite_ref-14\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-14\">[14]</a></sup></p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">The collective mood of&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Twitter\" href=\"https://en.wikipedia.org/wiki/Twitter\">Twitter</a>&nbsp;messages has been linked to stock market performance.<sup id=\"cite_ref-15\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-15\">[15]</a></sup>&nbsp;The study, however, has been criticized for its methodology.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">The activity in stock message boards has been mined in order to predict asset returns.<sup id=\"cite_ref-Galvez2017_16-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-Galvez2017-16\">[16]</a></sup></p>\r\n<h4 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom: 0px; line-height: 1.6; font-family: sans-serif;\"><span id=\"Applications_of_Complexity_Science_for_stock_market_prediction\" class=\"mw-headline\">Applications of Complexity Science for stock market prediction</span></h4>\r\n<p style=\"margin: 0.5em 0px; line-height: inherit; color: #222222; font-family: sans-serif;\">Using new statistical analysis tools of&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Complexity economics\" href=\"https://en.wikipedia.org/wiki/Complexity_economics\">complexity theory</a>, researchers at the&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"New England Complex Systems Institute\" href=\"https://en.wikipedia.org/wiki/New_England_Complex_Systems_Institute\">New England Complex Systems Institute</a>&nbsp;(NECSI) performed research on predicting&nbsp;<a style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Stock market crash\" href=\"https://en.wikipedia.org/wiki/Stock_market_crash\">stock market crashes</a>.<sup id=\"cite_ref-17\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-17\">[17]</a></sup><sup id=\"cite_ref-18\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-18\">[18]</a></sup><sup id=\"cite_ref-19\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 12px;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Stock_market_prediction#cite_note-19\">[19]</a></sup>&nbsp;It has long been thought that market crashes are triggered by panics that may or may not be justified by external news. This research indicates that it is the internal structure of the market, not external crises, which is primarily responsible for crashes. The number of different stocks that move up or down together were shown to be an indicator of the mimicry within the market, how much investors look to one another for cues. When the mimicry is high, many stocks follow each other\'s movements - a prime reason for panic to take hold. It was shown that a dramatic increase in market mimicry occurred during the entire year before each market crash of the past 25 years, including the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none;\" title=\"Financial crisis of 2007&ndash;08\" href=\"https://en.wikipedia.org/wiki/Financial_crisis_of_2007%E2%80%9308\">financial crisis of 2007&ndash;08</a>.</p>','2017-05-30 13:46:31'),(70,33,5,2,'add content','CPU_Prediction','CPU Prediction','<h1>1. Introduction</h1>\r\n<p>CPU utilization prediction is an important component of the resource allocation and job scheduling problems in virtualized servers and clouds. Utilization prediction is used by a resource manager to balance workload among physical nodes thus increasing the efficiency of resource usage. In the case of virtual machine distribution task the accurate prediction of CPU utilization allows to migrate one or more virtual machines, avoiding the physical machines\' overload.&nbsp;</p>\r\n<p>Here we tried some most popular approaches to CPU utilization prediction, the advantages and disadvantages of the methods being applied and the appliance limitations. We focus on regression models (ARFIMA and its special cases), Bayesian models, the Kalman filter and clustering.&nbsp;</p>\r\n<h1>2. Models</h1>\r\n<h2>2.1 regression model</h2>\r\n<h2>2.2 Bayesian model</h2>\r\n<p>&nbsp;</p>','2017-06-05 02:32:24'),(71,34,2,3,NULL,'Server_analysis','Server analysis','<p>Server analysis</p>','2017-06-05 03:03:35'),(72,34,2,1,'First Revision','Server_analysis','Server analysis','<p>Server analysis</p>','2017-06-05 03:03:35'),(73,33,2,3,'','CPU_Prediction','CPU Prediction','<h1>1. Introduction</h1>\r\n<p>CPU utilization prediction is an important component of the resource allocation and job scheduling problems in virtualized servers and clouds. Utilization prediction is used by a resource manager to balance workload among physical nodes thus increasing the efficiency of resource usage. In the case of virtual machine distribution task the accurate prediction of CPU utilization allows to migrate one or more virtual machines, avoiding the physical machines\' overload.&nbsp;</p>\r\n<p>Here we tried some most popular approaches to CPU utilization prediction, the advantages and disadvantages of the methods being applied and the appliance limitations. We focus on regression models (ARFIMA and its special cases), Bayesian models, the Kalman filter and clustering.&nbsp;</p>\r\n<h1>2. Models</h1>\r\n<h2>2.1 regression model</h2>\r\n<h2>2.2 Bayesian model</h2>\r\n<p>&nbsp;</p>','2017-06-05 03:09:59'),(74,33,2,4,'','CPU_Prediction','CPU Prediction','<h1>1. Introduction</h1>\r\n<p>CPU utilization prediction is an important component of the resource allocation and job scheduling problems in virtualized servers and clouds. Utilization prediction is used by a resource manager to balance workload among physical nodes thus increasing the efficiency of resource usage. In the case of virtual machine distribution task the accurate prediction of CPU utilization allows to migrate one or more virtual machines, avoiding the physical machines\' overload.&nbsp;</p>\r\n<p>Here we tried some most popular approaches to CPU utilization prediction, the advantages and disadvantages of the methods being applied and the appliance limitations. We focus on regression models (ARFIMA and its special cases), Bayesian models, the Kalman filter and clustering.&nbsp;</p>\r\n<h1>&nbsp;</h1>\r\n<p>&nbsp;</p>','2017-06-05 03:10:18'),(75,33,2,5,'','CPU_Prediction','CPU Prediction','<h6>&nbsp;</h6>\r\n<h2 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-weight: normal; margin: 1em 0px 0.25em; overflow: hidden; padding: 0px; border-bottom: 1px solid #a2a9b1; font-family: \'Linux Libertine\', Georgia, Times, serif; line-height: 1.3;\"><span id=\"References\" class=\"mw-headline\">Introduction</span></h2>\r\n<p>CPU utilization prediction is an important component of the resource allocation and job scheduling problems in virtualized servers and clouds. Utilization prediction is used by a resource manager to balance workload among physical nodes thus increasing the efficiency of resource usage. In the case of virtual machine distribution task the accurate prediction of CPU utilization allows to migrate one or more virtual machines, avoiding the physical machines\' overload.&nbsp;&nbsp;</p>\r\n<h2 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-weight: normal; margin: 1em 0px 0.25em; overflow: hidden; padding: 0px; border-bottom: 1px solid #a2a9b1; font-family: \'Linux Libertine\', Georgia, Times, serif; line-height: 1.3;\"><span id=\"References\" class=\"mw-headline\"></span><span id=\"References\" class=\"mw-headline\">References</span></h2>\r\n<p>[1] Kudinova M, Melekhova A, Verinov A. CPU utilization prediction methods overview[C]//Proceedings of the 11th Central &amp; Eastern European Software Engineering Conference in Russia. ACM, 2015: 7.</p>\r\n<p>&nbsp;</p>','2017-06-05 04:58:42'),(76,35,2,2,NULL,'Memory_Prediction','Memory Prediction','','2017-06-05 05:00:00'),(77,35,2,1,'First Revision','Memory_Prediction','Memory Prediction','','2017-06-05 05:00:00'),(78,33,5,6,'','CPU_Prediction','CPU Prediction','<h6>&nbsp;</h6>\r\n<h2 style=\"background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-weight: normal; margin: 1em 0px 0.25em; overflow: hidden; padding: 0px; border-bottom: 1px solid #a2a9b1; font-family: \'Linux Libertine\', Georgia, Times, serif; line-height: 1.3;\"><span id=\"References\" class=\"mw-headline\">Introduction</span></h2>\r\n<p>CPU utilization prediction is an important component of the resource allocation and job scheduling problems in virtualized servers and clouds. Utilization prediction is used by a resource manager to balance workload among physical nodes thus increasing the efficiency of resource usage. In the c