INSERT INTO `wiki_pages` VALUES (18,2,5,'None','None','','2017-05-21 09:57:36','2017-05-30 06:30:56',NULL,NULL),(33,2,25,'CPU_Prediction','CPU Prediction','<h5>Backgound</h5>\r\n<hr/>\r\n<p>Virtualization is a vital technology of cloud computing which enables the partition of a physical host into several Virtual Machines (VMs). The number of active hosts can be reduced according to the resources requirements using live migration in order to minimize the power consumption in this technology. Therefore, resource performance prediction is becoming more and more important in cloud environment, and CPU load prediction is helpful for system maintenance and application schedule.\r\n</p>\r\n<p>\r\nCPU load prediction method is employed in the live migration process to predict over-loaded and under-loaded hosts. When a host becomes over-loaded, some VMs migrate to other hosts to avoid SLA violation. However, the best predictor often varies from one resource to another. At the same time, CPU load in cloud environment has a wide range of dynamics so that the best predictor for any particular CPU load time series may change over time.</p>\r\n<br/>\r\n<h5>Related Research</h5>\r\n<hr/>\r\n<p>\r\nSo far, the method of the weighted average to predicted single resource change trend is widely used in the existing models. The research emphasis is to design the weighting efficient system. A good weighting efficient system means an accurate predicted result. But with much subjectivity and arbitrariness it is very difficult to design a good system. \r\n</p>\r\n<p>\r\nBy researching, it is found that a time series process consists of a linear structure and a nonlinear structure that means the change trend rule can be found easily by the time series.\r\n</p>\r\n<p>\r\nThe linear prediction model is mainly adopted in the time series prediction method. Compared with the traditional data processing algorithms, BP neural network is an effective nonlinear modeling method. It has great advantages in processing the feature-undefined data that with much randomness, nonlinearity and noisy. Implied non-linear relationships can be excavated out from the database by the BP model. But it is weaker in process the linear data than the traditional methods such as time series model. \r\n</p>','2017-05-25 11:07:03','2017-08-16 10:40:54',NULL,'/resources/image/cpu.png'),(35,2,5,'Memory_Prediction','Memory Prediction','<h5>Backgound</h5>\r\n<hr/>\r\n<p>\r\nThe evolution of IT software services in the direction of Cloud Computing took a step forward in the efficient use of hardware resources through virtualization. The Cloud approach consists in offering ondemand virtualized resources to its users. Because virtual resources can be added or removed at any time during the lifetime of the application hosted on a Cloud, the possibility of dynamic scaling arises.\r\n</p>\r\n<p>\r\nThe main problem with dynamic provisioning is the fact that new resources are not obtained instantaneously, they have a start-up time that is not negligible. To address this, current strategies use a predictive approach in hopes of getting an insight into future platform usage and, as a consequence, being able to make scaling decisions ahead of time, compensating for the resource start-up time.\r\n</p>\r\n<br/>\r\n<h5>Related Research</h5>\r\n<hr/>\r\n<p>\r\nA description and comparison of three different auto-scaling algorithms is given in [1]: Auto-Regression of order 1 (AR1), Linear Regression, and the Rightscale algorithm.\r\n</p>\r\n<p>\r\nWith predictions for both memory and CPU usages, the scaling component of the Cloud client should be able to more accurately decide the characteristics of the virtual resources that are to be instantiated or released. The topic of making a good scaling decision both in direction and in virtual machine characteristics is an interesting topic of research, yet it is beyond the scope of the current work.\r\n</p>','2017-06-05 05:00:00','2017-08-18 02:44:32',NULL,'/upload/user_picture/aad21c56-bb15-4b09-ad58-263b38354b0f_memory.jpg'),(37,5,5,'User_classification','User Classification','<h5>Background</h5>\r\n<hr/>\r\n<p>\r\nIn the recent cloud computing research field, the virtual resource management problem has become a hotspot. The VM dynamic deployment technique is one of the key virtual resource management technique. Many experts have done a lot of research about it. At present, the study of the VM resource dynamic deployment focus on the fine-grained resource adjustment strategy. Requests from different user have different characteristics.\r\n</p>\r\n<p>\r\nFor example, some user prefer to send  I/O-intensive requests, but some user prefer to send CPU-intensive requests. Some users have more request during worktime, but other user request smoothly. \r\nClustering of different users is conducive to forecasting the request load and server load scheduling.\r\n</p>\r\n<p>\r\nThis application include the task of user clustering in cloud computing. The algorithm classify the user by attributes such as request resources and request time and request number.\r\n</p>\r\n\r\n<br/>\r\n\r\n<h5>Related Work</h5>\r\n<hr/>\r\n<p>\r\nThe notion of a \"cluster\" cannot be precisely defined, which is one of the reasons why there are so many clustering algorithms. Typical cluster models include:\r\n</p>\r\n<li>\r\nConnectivity models: for example, hierarchical clustering builds models based on distance connectivity.\r\n</li>\r\n<li>\r\nCentroid models: for example, the k-means algorithm represents each cluster by a single mean vector.\r\n</li>\r\n<li>\r\nDistribution models: clusters are modeled using statistical distributions, such as multivariate normal distributions used by the expectation-maximization algorithm.\r\n</li>\r\n<li>\r\nDensity models: for example, DBSCAN and OPTICS defines clusters as connected dense regions in the data space.\r\n</li>\r\n<li>\r\nSubspace models: in biclustering (also known as co-clustering or two-mode-clustering), clusters are modeled with both cluster members and relevant attributes.\r\n</li>\r\n<li>\r\nGroup models: some algorithms do not provide a refined model for their results and just provide the grouping information.\r\n</li>\r\n<li>\r\nGraph-based models: a clique, that is, a subset of nodes in a graph such that every two nodes in the subset are connected by an edge can be considered as a prototypical form of cluster. Relaxations of the complete connectivity requirement (a fraction of the edges can be missing) are known as quasi-cliques, as in the HCS clustering algorithm.\r\n</li>\r\n<li>\r\nNeural models: the most well known unsupervised neural network is the self-organizing map and these models can usually be characterized as similar to one or more of the above models, and including subspace models when neural networks implement a form of Principal Component Analysis or Independent Component Analysis.\r\n</li>\r\n\r\n\r\n','2017-06-05 12:23:36','2017-08-18 15:26:43',NULL,'/resources/image/user.jpg'),(249,1,5,'Stock_Prediction','Stock Prediction','<h5>Backgound</h5>\r\n<hr/>\r\n<p>\r\nThe stock market is a complex, evolutionary and dynamical system. There are many factors interacting in finance, which include political events, general economic situations and trader\'s expectations. Undoubtedly, predicting stock market price movements is quite a difficult and challenging task. Conventional statistical methods such as time series and multivariate analyses have been used in most prediction techniques. However, researchers have started to use artificial intelligence(AI) methods to financial markets, because of recent successful developments such as artificial neural networks(ANNs), support vector machines(SVMs), etc.\r\n</p>\r\n<p>\r\nFor stock prediction with ANNs, there are usually two approaches taken for forecasting different time horizons: independent and joint. The independent approach employs a single ANN for each time horizon, for example, 1-day or 2-day. The advantage of this approach is that network forecasting error for one horizon will not impact the error for another horizon. The joint approach, however, incorporates multiple time horizons together so that they are determined simultaneously.\r\n</p>\r\n<br/>\r\n<h5>Related Research</h5>\r\n<hr/>\r\n<p>\r\nThe popular form of ANN that is more appropriate for stock prediction is the time recurrent neural network (RNN) or time delay neural network (TDNN). Examples of RNN and TDNN are the Elman, Jordan, and Elman-Jordan networks. \r\n</p>\r\n<p>\r\nSome recent researches suggest that news and social media such as blogs, micro-blogs, etc., can be analyzed to extract public sentiments to help predict the market(Schumaker and Chen, 2009). Bollen et al.(2011) used tweet based public mood to predict the movement of Dow Jones Industrial Average index. \r\n</p>','2017-07-30 18:52:24','2017-08-18 15:26:58',NULL,'/resources/image/stock.jpg');
