INSERT INTO `workflow_informations` VALUES (267,'Linear Regression','A linear classifier achieves this by making a classification decision.','<p>Linear regression only supports regression type problems.</p>\r\n<p>It works by estimating coefficients for a line or hyperplane that best fits the training data. It is a very simple regression algorithm, fast to train and can have great performance if the output variable for your data is a linear combination of your inputs.</p>\r\n<p>It is good idea to evaluate linear regression on your problem before moving onto more complex algorithms in case it performs well.</p>\r\nValid options are:\r\n<p>\r\n<li> Produce debugging output \r\n<br/>\r\n    &nbsp;&nbsp;Default no debugging output\r\n</li>\r\n\r\n<li>number of selection method\r\n<br/>\r\n     &nbsp;&nbsp;Set the attribute selection method to use\r\n</li>\r\n<li>\r\nR\r\n<br/>\r\n     &nbsp;&nbsp;Set ridge parameter (default 1.0e-8).\r\n</li>\r\n</p>',NULL,1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-30 21:08:43','2017-08-15 16:16:00',NULL,NULL,9,4,3,81),(269,'SMOreg','SMOreg implements the support vector machine for regression.','<p>SMOreg implements the support vector machine for regression. The parameters can be learned using various algorithms. The algorithm is selected by setting the RegOptimizer. The most popular algorithm (RegSMOImproved) is due to Shevade, Keerthi et al and this is the default RegOptimizer.</p>\r\n<p>Valid options are:\r\n <li>C </li>\r\n&nbsp; &nbsp; The complexity constant C.\r\n\r\n <li>Classname and parameters</li>\r\n&nbsp; &nbsp;Optimizer class used for solving quadratic optimization problem\r\n<br/>\r\n&nbsp; &nbsp; Default: weka.classifiers.functions.supportVector.RegSMOImproved\r\n <li>Classname and parameters</li>\r\n&nbsp; &nbsp; The Kernel to use. \r\n<br/>\r\n&nbsp; &nbsp; Default: weka.classifiers.functions.supportVector.PolyKernel\r\n<li>Options specific to optimizer</li>\r\n&nbsp; &nbsp; Default: weka.classifiers.functions.supportVector.RegSMOImproved:\r\n </p>',NULL,1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-30 21:43:11','2017-07-31 00:52:13',NULL,NULL,4,3,1,82),(270,'Hierarchical Clustering','hierarchical clustering seeks to build a hierarchy of clusters.','<p>Hierarchical clustering class. Implements a number of classic hierarchical clustering methods.</p>\r\n<p>Valid options are: </p>\r\n <p>\r\n<li>N</li>\r\n&nbsp;&nbsp;Number of clusters\r\n <li>Link type</li>\r\n &nbsp; &nbsp;Include: Single, Complete, Average, Mean, Centroid, Ward, Adjusted complete, Neighbor Joining) \r\n<li>Distance function to use</li> \r\n&nbsp;&nbsp;default: weka.core.EuclideanDistance\r\n',NULL,2,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-30 21:47:55','2017-07-31 00:44:56',NULL,NULL,2,1,1,86),(271,'Canopy','The canopy clustering algorithm is an unsupervised pre-clustering algorithm.','<p>Cluster data using the k means algorithm. Can use either the Euclidean distance (default) or the Manhattan distance. If the Manhattan distance is used, then centroids are computed as the component-wise median rather than mean. </p>\r\n<p> D. Arthur, S. Vassilvitskii: k-means++: the advantages of carefull seeding. In: Proceedings of the eighteenth annual ACM-SIAM symposium on Discrete algorithms, 1027-1035, 2007. </p>\r\n<p>Valid options are:\r\n<br /> \r\n<li>num</li>\r\n  &nbsp; &nbsp;Number of clusters.\r\n  (default 2).\r\n<br />\r\n<li>init</li>\r\n  &nbsp; &nbsp;Initialization method to use.\r\n  0 = random, 1 = k-means++, 2 = canopy, 3 = farthest first.\r\n  (default = 0)\r\n <br />\r\n <li>C</li>\r\n &nbsp; &nbsp; Use canopies to reduce the number of distance calculations.\r\n</p>\r\n\r\n',NULL,2,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-30 21:55:57','2017-07-31 00:54:36',NULL,NULL,3,2,1,84),(284,'Clustering by K-Means ','This is K-Means algorithm.','<p>\r\nk-means clustering is a method of vector quantization, originally from signal processing, that is popular for cluster analysis in data mining. k-means clustering aims to partition n observations into k clusters in which each observation belongs to the cluster with the nearest mean, serving as a prototype of the cluster. This results in a partitioning of the data space into Voronoi cells.\r\n</p>\r\n<p>\r\n  The model can be used by the parameters below:\r\n</p>\r\n<li>\r\n  N \r\n<br/>\r\n  Number of clusters.\r\n  (default 2).\r\n</li>\r\n<li> \r\n  init\r\n<br/>\r\n  Initialization method to use.\r\n  0 = random, 1 = k-means++, 2 = canopy, 3 = farthest first.\r\n  (default = 0)\r\n </li>\r\n<li>\r\n  C\r\n<br/>\r\n  Use canopies to reduce the number of distance calculations.\r\n </li>\r\n<li>\r\n  max-candidates \r\n<br/>\r\n  Maximum number of candidate canopies to retain in memory\r\n  at any one time when using canopy clustering.\r\n  (default = 100)\r\n</li>\r\n<li>\r\n  periodic-pruning \r\n<br/>\r\n  How often to prune low density canopies when using canopy clustering. \r\n  (default = every 10,000 training instances)\r\n</li>\r\n<li>\r\n  min-density\r\n<br/>\r\n  Minimum canopy density, when using canopy clustering, below which\r\n   a canopy will be pruned during periodic pruning. (default = 2 instances)\r\n </li>\r\n<li>\r\n  t2\r\n<br/>\r\n  The T2 distance to use when using canopy clustering. Values < 0 indicate that\r\n  a heuristic based on attribute std. deviation should be used to set this.\r\n  (default = -1.0)\r\n</li>\r\n<li>\r\n  t1\r\n<br/>\r\n  The T1 distance to use when using canopy clustering. A value < 0 is taken as a\r\n  positive multiplier for T2. (default = -1.5)\r\n</li>\r\n<li>\r\n  A \r\n<br/>\r\n  Distance function to use.\r\n  (default: weka.core.EuclideanDistance)\r\n</li>\r\n<li>\r\n  I \r\n<br/>\r\n  Maximum number of iterations.\r\n</li>\r\n<li>\r\n  S\r\n<br/>\r\n  Random number seed.\r\n  (default 10)\r\n</li>\r\n ',NULL,2,NULL,5,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-18 00:14:03','2017-08-18 15:16:06',NULL,NULL,0,1,0,85);
